function Cadastro() {

  const user = useSelector(state => state.user.data); 

    const view = () => {

    const ViewTrue = () => {
      return (
        <View public={true}>
          <InitCadastro/>
        </View>
      )
    }

    const ViewFalse = () => {
      <Redirect to={"/"} />
    }

    if (user ==true) {
        ViewTrue
    } else {
      ViewFalse
    }

  }

}

export default Cadastro
